
class SkimDataset:
    def __init__(self, id, nick, isData, njobs,  gtag, parent, version = ''):
        self.id      = id
        self.nick    = nick
        self.isData  = isData
        self.njobs   = njobs 
        self.gtag    = gtag
        self.parent  = parent
        self.version = version
        
    def __str__(self):
        return 'id('+self.id+') nick: '+self.nick+' data: '+str(self.isData)+' njobs:'+str(self.njobs)+' gtag: '+self.gtag


